def _unstack_multiple(data, clocs, fill_value=None):
    if len(clocs) == 0:
        return data

    index = data.index
    cindices = [i for i in range(len(index.names)) if index.names[i] in clocs]

    if len(cindices) == 0:
        raise ValueError("No valid cindices found")

    vals = np.zeros(data.shape[0] * len(cindices), dtype=data.values.dtype)
    locs = np.zeros(vals.size, dtype=int)

    iterables = [index.levels[i] for i in cindices]
    labels = index.labels

    for i in range(len(cindices)):
        vals[i::len(cindices)] = data.values.take(labels[cindices[i]])
        locs[i::len(cindices)] = labels[cindices[i]]

    new_index = MultiIndex.from_product(iterables, names=[index.names[i] for i in cindices])

    if isinstance(data, Series):
        return Series(vals, index=new_index)
    else:
        return DataFrame(vals, index=new_index)
